import './App.css';

function App() {
  return (
    <div className="App">

      <div className="mainHeading">
        <h1>TO- DO- LIST</h1>
      </div>
      <div className="subHeading">
          <h2>TO DO</h2>
          <div className="input">
            <input type="text" placeholder="Add item" />
          </div>
      </div>

      <div className="active">
        <h2>Active</h2>
      </div>
      <div className="completed">Completed</div>
      <div className="all">All</div>

    </div>
  );
}

export default App;
